import React from 'react';

const SubmissionsTable = ({ submissions }) => {
  if (submissions.length === 0) {
    return (
      <div className="text-center py-8 text-gray-500">
        <p>No submissions yet. Be the first to submit your project!</p>
      </div>
    );
  }

  return (
    <div className="space-y-3">
      {submissions.map((submission, index) => (
        <div 
          key={submission._id || index} 
          className="bg-gray-50 rounded-lg p-4 border border-gray-200 hover:bg-gray-100 transition-colors duration-200"
        >
          <div className="flex items-center justify-between">
            <div className="flex items-center space-x-3">
              <div className="w-8 h-8 bg-blue-600 rounded-full flex items-center justify-center">
                <span className="text-white font-semibold text-sm">
                  {submission.teamName.charAt(0).toUpperCase()}
                </span>
              </div>
              <div>
                <h3 className="text-lg font-semibold text-gray-900">
                  {submission.teamName}
                </h3>
                <p className="text-sm text-gray-500">
                  Project Submitted
                </p>
              </div>
            </div>
            <div className="text-right">
              <div className="text-xs text-gray-400">
                Submitted
              </div>
              <div className="text-sm font-medium text-gray-600">
                âœ“
              </div>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default SubmissionsTable;
